import React from 'react';
import {SidebarContainer, Icon, CloseIcon} from './SidebarElements';


//SidebarWrapper
//SidebarMenu
//SidebarLink

const Sidebar = () =>{
	return (
		<SidebarContainer>
			<Icon>
				<CloseIcon />
			</Icon>
			<SidebarWrapper>
				<SidebarMenu>
					<SidebarLink to="about">
						About
					</SidebarLink>
					<SidebarLink to="discover">
						Discover
					</SidebarLink>
					<SidebarLink to="services">
						Serivces
					</SidebarLink>
					<SidebarLink to="signup">
						Sign Up
					</SidebarLink>
				</SidebarMenu>
			</SidebarWrapper>
		</SidebarContainer>
	)
}

export default Sidebar;
